import React, { Component } from 'react';

import { startUI } from '../../services/firebase'





class Login extends React.Component {
    
    
    

  componentWillMount(){
  
    startUI('#firebaseui')
  }




  render() {
    return (
    <div id="firebaseui"></div>

    
    );
  }
}

export default Login;
